import React from "react";
import "./experience.css";


export const Experience = () => {
  return (
    <section id="experience">
      <h5>What skills i have</h5>
      <h2>My Experience</h2>
      <div className="container experience__container">
        Currently have a lot of Experience when it comes to Wordpress development. From hosting to maintenance.
        Also, when it comes to the business side of things I have so much experience.
        You don't trust clients who come offering a small amount for a service in exchange for them to bring you more clients.
        Such clients will just drain away your energy and trust me, they will japa immediately you offer them that deal. 
      </div>
    </section>
  );
};
export default Experience;
